import CircleButton from "../comm/CircleButton";

const CalCalrorie = () => {
    return (
        <div className="flex py-20 space-x-20 justify-center ">
            <CircleButton name="일별칼로리" color="#508D69" background="white"/>
            <CircleButton name="주별칼로리" color="#9ADE7B" background="white"/>
            <CircleButton name="월별칼로리" color="#A6CF98" background="white"/>
        </div>
    );
}

export default CalCalrorie
